import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import { AppBar, IconButton, Toolbar } from '@material-ui/core';
import SortIcon from '@material-ui/icons/Sort';
import { useHistory } from 'react-router-dom';
import { Nav, Navbar, NavDropdown } from 'react-bootstrap'


function NavBar() {
    let history = useHistory();
    const useStyles = makeStyles((theme) => ({
        appbar: {
            // background: 'none',
            textAlign: 'left',
            background: '#FCC4D6',
            // display: 'block',
        },
        appbarTitle: {
            flexGrow: '2',
            color: 'white',
            underline: 'none',
            fontSize: '1.5rem',
            textDecoration: 'none' 
        },
        colorText: {
            color:'rgb(126, 186, 255)',
        },
        title: {
            fontSize: '1rem'
        }

    }));
    const classes = useStyles()

    function handleClick() {
        history.push('/shop')
    }

    return (
        // <div>
        //     <AppBar className={classes.appbar} elevation={0}>
        //         <Toolbar className={classes.appbarWrapper} >
        //         <a href="/" className={classes.appbarTitle}>Jay's<span className={classes.colorText}>List</span></a>
        //         <a href="/shop">Products</a>
        //         <a href="/profile">Profile</a>
        //         </Toolbar>
        //     </AppBar>
        // </div>
        <Navbar className={classes.appbar} collapseOnSelect expand="sm"  variant="light">
        <Navbar.Brand href="/"><h5 className={classes.appbarTitle}>Jay's<span className={classes.colorText}>List</span></h5></Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
          </Nav>
          <Nav>
            <Nav.Link className={classes.colorText} href="/shop">Products</Nav.Link>
            <Nav.Link className={classes.colorText} href="/cart">Cart</Nav.Link>
            <Nav.Link className={classes.colorText} href="/log-in">LogIn</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    )
}

export default NavBar;
